{'response': 'Dear love, for nothing less than thee,
The moon would trade her silver sea;
The rose would shed her velvet red,
And dawn forsake her golden bed.

For nothing less than thee, my heart
Would brave the storms, would worlds depart;
The stars would fall, the night would flee—
All pale beside thy constancy.

So let the world its riches keep,
Its fleeting joys, its shallow sleep;
For all I seek, and all I see,
Is dear love, nothing less than thee.', 'probability': 1.0}

{'response': "War's a joke for me and you,
